const AccountManagementPage = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <h1>Account Management</h1>
        </div>
      </div>
      <div className="row">
        <div className="col">
          {/* Your content here */}
        </div>
      </div>
    </div>
  );
};

export default AccountManagementPage;
